import React, { Component } from 'react'
import ReactDOM from 'react-dom';
import { useEffect } from 'react'
import Slider from "react-slick";

import Image from './ny.jpg'



export default function HomeComponent() {

    



        var settings = {
      dots: true,
      infinite: true,
      slidesToShow: 3,
      slidesToScroll: 1,
      autoplay: true,
      autoplaySpeed: 2000
    };

        return (


<Slider  {...settings}>
                <div>
                    <img src={Image} />
                </div>
                <div>
                    <img src={Image} />
                </div>
                <div>
                    <img src={Image}  />
                </div>
                
</Slider>

        )
    }
